css:
@-moz-document regexp(".*/job/.*") {
a:visited {
	text-decoration: underline;
	color: #efb2f6;
}
a:link {
	text-decoration: underline;
	color: #c1d4f0;
}
body,
table,
form,
td,
th,
p {
	color: #BBB;
	background-color: #222;
}
div.pane-header {
	font-weight: bold;
	padding-right: 24px;
	background-color: #555;
	color: #000;
	border: solid 1px #101010;
}
.col-xs-24 {
	width: 100%;
	background-color: #888;
	color: #000;
	border: solid 1px #101010;
}
.pane.build-details a,
.pane.build-details a:visited {
	color: #BBB;
	opacity: 0.6;
	text-decoration: none;
}
#breadcrumbs {
	list-style-type: none;
	padding: 0 0 0 8px;
	margin: 0;
	height: 2em;
	border-bottom: 1px solid #000;
	display: block;
	background-color: #111;
}
footer {
	padding: 11px 0;
	background-color: #111;
	border-top: 1px solid #000;
	border-bottom: 1px solid #000;
	width: 100%;
	position: absolute;
	bottom: 0;
	left: 0;
	clear: both;
	font-size: 12px;
	text-align: right;
}
.pane-frame {
	border: solid 1px #101010;
	border-radius: 4px;
}

#pipeline-box .table-box .table-viewPort {
	display: inline-block;
	border: 1px solid #333333;
	overflow-x: auto;
	overflow-y: hidden;
	box-shadow: rgba(0, 0, 0, 0.25) 1px 3px 5px;
}
}
